import React, { useState, useEffect } from 'react';
import Head from 'next/head'
import Link from 'next/link'
import Layout from '../components/layout'
import { channelNames, EEGReading, MuseClient } from 'muse-js';

function Visualizations() {
  const [museClient] = useState(new MuseClient())

  function startConnection(e) {
    museClient.start()
    //Create websocket connection to Flask server here
  }

  return (
    <Layout>
      <Head>
        <title>EEG Visualizations</title>
      </Head>
      <h1>Connect your Muse Headset!</h1>
      <div>
        <button onClick={() => museClient.connect()}>
          Connect
        </button>
        <button onClick={startConnection}>
          Start Recording!
        </button>
      </div>
    </Layout>
  );
}

export default App;
